La ocultaci√≥n de una variable sucede cuando se usa let para declarar una nueva variable con el mismo nombre que otra. A primera vista se parece a la mutabilidad, pero es totalmente diferente. En el siguiente ejemplo, se oculta una variable: fn main() { let mi_numero = 8; // Esta variable es i32 println!("{}", mi_numero); // imprime 8 let mi_numero = 9.2; // Esta variable es f64 y tiene el mismo nombre // pero es una variable nueva, completamente diferente. println!("{}", mi_numero) // imprime 9.2
} Se dice que hemos "ocultado" mi_numerocon un nuevo "enlace". ¬øSe ha destruido la anterior variable mi_numero? No, pero cuando se llama a mi_numero ahora se accede a la segunda variable de tipo f64. Y como ambas declaraciones se encuentran en el mismo bloque de c√≥digo (mismo √°mbito, mismo {}), se deja de tener acceso al mi_numero de tipo i32. Si estuvieran en diferentes bloques de c√≥digo, podr√≠amos volver a acceder a la primera variable mi_numero. Por ejemplo: fn main() { let mi_numero = 8; // Esta variable es i32 println!("{}", mi_numero); // imprime 8 { let mi_numero = 9.2; // Esta variable es f64 y tiene el mismo nombre // pero es una variable nueva, completamente diferente. println!("{}", mi_numero) // imprime 9.2 // pero la nueva variable mi_numero // solo existe hasta aqu√≠ // la anterior ¬°sigue viva! } println!("{}", mi_numero); // imprime 8
} En resumen, cuando ocultas una variable, no la destruyes. La bloqueas . Qu√© ventajas tiene el ocultar variables. Es una buena pr√°ctica cuando necesitas modificar una variable en muchas ocasiones. Imagina que quieres hacer un conjunto de c√°lculos matem√°ticos simples con una variable: fn dos_veces(numero: i32) -> i32 { numero * 2
} fn main() { let numero_final = { let y = 10; let x = 9; // x comienza con 9 let x = dos_veces(x); // se oculta con el nuevo x: 18 let x = x + y; // se oculta con el nuevo x: 28 x // devuelve x: a numero_final se asigna este valor de x }; println!("El n√∫mero ahora es: {}", numero_final)
} Sin ocultar las variables anteriores, habr√≠a sido necesario pensar diferentes nombres, incluso aunque no nos importen estos valores intermedios: fn dos_veces(numero: i32) -> i32 { numero * 2
