Puedes ver este cap√≠tulo en YouTube en ingl√©s Si se necesita modificar un valor a trav√©s de una referencia, se debe indicar que la referencia sea modificable (mutable). Para ello, se utiliza &mut en lugar de &. fn main() { // no hay que olvidar que hay que escribir mut en la variable original let mut mi_numero = 8; let num_ref = &mut mi_numero;
