segundo_numero = ¬øtriple_referencia? true El uso del operador sobre una variable & se denomina "referenciar". El uso del operador sobre una variable de referencia * se denomina " des referenciar". Rust usa dos reglas para las referencias mutables e inmutables. Son muy importantes y f√°ciles de recordar porque tienen sentido. Regla 1 : Si solo existen referencias inmutables a un valor, se pueden tener tantas como se quiera. Regla 2 : Si existe una referencia mutable a un valor, solo puede existir una referencia. Esto √∫ltimo significa que no pueden existir a la vez referencias inmutables y mutables en el mismo momento. Estas reglas son necesarias debido a que las referencias mutables pueden cambiar los datos. Ser√≠a problem√°tico que se modificara un dato cuando otras referencias lo est√°n usando. Un forma de entenderlo es pensar en la creaci√≥n de una presentaci√≥n de Powerpoint [1] . No se trata de un ejemplo excesivamente bueno, ya que actualmente es posible editar simult√°neamente en Office 365. El primer caso representa el de la existencia de una referencia mutable : un empleado est√° editando una presentaci√≥n de Powerpoint. Piode ayuda a su jefe. El empleado entrega sus credenciales de acceso a su jefe para que pueda editar el Powerpoint. Ahora el jefe tiene una "referencia mutable" a la presentaci√≥n de su empleado. El jefe puede hacer los cambios que quiera y devolver el ordenador m√°s tarde. Nadie m√°s tiene acceso a la presentaci√≥n, por lo que este caso no da problemas. El segundo caso representa el de **la existencia √∫nicamente de referencias inmutables": El empleado entrega la presentaci√≥n a 100 personas. Todas ellas pueden verla. Tienen una "referencia inmutable" a la presentaci√≥n ya que nadie puede modificarla, por lo que este caso no da problemas. El tercer caso representa la situaci√≥n problem√°tica a evitar : El empleado entrega sus credenciales de acceso a su jefe, que a partir de aqu√≠ dispone de una "referencia mutable". Adem√°s, el empleado