} El c√≥digo anterior imprime Es un n√∫mero impar positivo porque cuando se divide entre 2 el resto es 1, que es mayor que 0. Se observa que cuando hay demasiados if, else y else if el c√≥digo puede resultar dif√≠cil de leer. En estos casos (y en otros muchos) se puede utilizar match, que resulta mucho m√°s l√≠mpio. match requiere que se contemplen todos los casos posibles para evitar errores. As√≠ que el siguiente c√≥digo no funciona: fn main() { let my_number: u8 = 5; match my_number { 0 => println!("Es cero"), 1 => println!("Es uno"), 2 => println!("Es dos"), // ‚ö†Ô∏è }
} El compilar indica lo siguiente: error[E0004]: non-exhaustive patterns: `3u8..=std::u8::MAX` not covered --> src\main.rs:3:11 |
3 | match my_number { | ^^^^^^^^^ pattern `3u8..=std::u8::MAX` not covered El compilador se queja de que solo conoce lo que tiene que ejecutar los casos de 0 a 2, pero u8 puede tener valores hasta el 255 (es decir std::u8::MAX). Qu√© debe hacer el programa para el resto de valores posibles que pueden aparecer. fn main() { let my_number: u8 = 5; match my_number { 0 => println!("Es cero"), 1 => println!("Es uno"), 2 => println!("Es dos"), _ => println!("Es alg√∫n otro n√∫mero"), }
} Este c√≥digo imprime Es alg√∫n otro n√∫mero. Para el caso de match hay que recordar que: A todo match le sigue un bloque de c√≥digo {} Se escriben los patrones a la izquierda y se usa => (flecha gruesa -fat arrow-) para indicar qu√© hay que hacer cuando hay una coincidencia. A cada l√≠nea con un patr√≥n se le denomina "brazo" del match. Entre cada "brazo" se pone una coma de separaci√≥n (no se usa el punto y coma). Se puede declarar un valor usando match ya que retorna una valor. fn main() { let my_number = 5; let second_number = match my_number { 0 => 0, 5 => 10, _ => 2, };
} En el ejemplo anterior, second_number tendr√° el valor 10. El match, en este caso acaba con un ; ya que una vez se ha finalizado su evaluaci√≥n esta sentencia es como si se hubiese escrito let second_number = 10;. Que define y asigna el 10 a second_number. match se puede utilizar para cosas m√°s complejas. Por ejemplo, con tuplas: fn main() { let sky = "nuboso"; let temperature = "c√°lido"; match (sky, temperature) { ("nuboso", "fr√≠o") => println!("El d√≠a es oscuro y desapacible"), ("despejado", "c√°lido") => println!("El d√≠a es agradable"), ("nuboso", "c√°lido") => println!("El d√≠a es oscuro, pero no se est√° mal"), _ => println!("No s√© c√≥mo es el d√≠a de hoy"), }
} Este c√≥digo imprime El d√≠a es oscuro, pero no se est√° mal porque coincide con "nuboso" y "c√°lido" para sky y temperature. Incluso se puede utilizar if en las ramas de un match. Es lo que se llama una "guarda de coincidencia" (match guard): fn main() { let children = 5; let married = true; match (children, married) { (children, married) if married == false => println!("Sin casar con {} ni√±os", children), (children, married) if children == 0 && married == true => println!("Casado, pero sin ni√±os"), _ => println!("¬øCasado? {}. N√∫mero de ni√±os: {}.", married, children), }
} Este progrma imprimir√° ¬øCasado? true. N√∫mero de ni√±os: 5. Se puede usar _ tantas veces como se necesite en un match. fn match_colours(rbg: (i32, i32, i32)) { match rbg { (r, _, _) if r < 10 => println!("No muy rojo"), (_, b, _) if b < 10 => println!("No muy azul"), (_, _, g) if g < 10 => println!("No muy verde"), _ => println!("Cada color tiene al menos 10"), }
} fn main() { let first = (200, 0, 0); let second = (50, 50, 50); let third = (200, 50, 0); match_colours(first); match_colours(second); match_colours(third); } Este c√≥digo imprime: No muy azul
Cada color tiene al menos 10
No muy verde Este c√≥digo tambi√©n muestra c√≥mo funcionan las sentencias match, porque en el primer ejemplo solo imprime No muy rojo, aunque tampoco tiene mucho verde. Las sentencias match siempre se detienen cuando encuentran una coincidencia y no chequea el resto de los "brazos". Es un buen ejemplo de c√≥digo que compila bien, pero no hace lo que se quiere. Se puede construir una sentencia matchgigante para arreglar este c√≥digo, pero probablemente es mejor utilizar un bucle for. M√°s adelante se hablar√° de los bucles. La sentencia match siempre tiene que devolver el mismo tipo de datos en todas sus ramas. Por eso, este c√≥digo no funciona: fn main() { let my_number = 10; let some_variable = match my_number { 10 => 8, _ => "Not ten", // ‚ö†Ô∏è };
} El compilador indica lo siguiente: error[E0308]: `match` arms have incompatible types --> src\main.rs:17:14 |
15 | let some_variable = match my_number { | _________________________-
16 | | 10 => 8, | | - this is found to be of type `{integer}`
17 | | _ => "Not ten", | | ^^^^^^^^^ expected integer, found `&str`
18 | | }; | |_____- `match` arms have incompatible types El c√≥digo siguiente, por la misma raz√≥n, tampoco funciona: fn main() { let some_variable = if my_number == 10 { 8 } else { "something else "}; // ‚ö†Ô∏è
} Pero el siguiente c√≥digo s√≠ funciona, porque no es un matchy son dos sentencias diferentes: fn main() { let my_number = 10; if my_number == 10 { let some_variable = 8; } else { let some_variable = "Something else"; }
} Tambi√©n se puede usar @ para darle un nombre al valor de un patr√≥n match con el fin de poder usarlo en la expresi√≥n correspondiente a ese "brazo". En este ejemplo, se guarda el valor en una variable number para pasarlo a una funci√≥n. Si es 4 o 13 se usa ese number en la sentencia println!. En otro caso, no se utiliza. fn match_number(input: i32) { match input { number @ 4 => println!("{} da mala suerte en China (suena parecido a Ê≠ª)", number), number @ 13 => println!("{} da mala suerte en Norte Am√©rica, ¬°Suerte en Italia! In bocca al lupo", number), _ => println!("Es un n√∫mero normal"), }
} fn main() { match_number(50); match_number(13); match_number(4);
} Este c√≥digo imprime: Es un n√∫mero normal
13 da mala suerte en Norte Am√©rica, ¬°Suerte en Italia! In bocca al lupo
4 da mala suerte en China (suena parecido a Ê≠ª)

