Puedes ver este cap√≠tulo en ingl√©s en YouTube Los comentarios son para que los lean los programadores, no el ordenador. es bueno escribir comentarios para ayudar a otras personas a entender tu c√≥digo. Es bueno, tambi√©n, para ayudarte a entender tu propio c√≥digo pasado un tiempo (Muchas personas escriben buen c√≥digo, pero olvidan porqu√© lo escribieron). Para escribir comentarios en el c√≥digo, en Rust se suele usar //: fn main() { // Los programas Rust comienzan en fn main() // Pones el c√≥digo en un bloque que comienza con { y termina con } let algun_numero = 100; // Aqu√≠ podemos esribir todo lo que queramos ya que el compilador no lo va mirar
} Cuando lo haces as√≠, el compilador no mirar√° nada que haya a la derecha de //. Existe otra clase de comentario que se escribe con /* para iniciarlo y se termina con `*/. Este tipo de comentario es √∫til para escribirlo entre el c√≥digo. fn main() { let algun_numero/*: i16*/ = 100;
} Para el compilador let algun_numero/*: i16*/ = 100; es igual que let algun_numero = 100;. Esta forma /* */ tambi√©n es √∫til para los comentarios de gran longitud que necesiten m√°s de una l√≠nea. En este ejemplo se puede ver que necesitas escribir // en cada l√≠nea, pero si utilizas /*, el comentario dura hasta que lo finalices con */. fn main() { let algun_numero = 100; /* D√©jame contarte un poco sobre este n√∫mero. Es el 100, que es mi n√∫mero favorito. Se llama algun_numero pero realmente creo que...*/ let algun_numero = 100; // D√©jame contarte // un poco sobre este n√∫mero. // Es el 100, que es mi n√∫mero favorito. // Se llama algun_numero pero realmente creo que...
}

